define('modules/competitions/admin/editContest',[

	'app',
	'backbone',
	'utils',
	'moment',
	'API',
	'crossdomain',
	'imagesLoaded',
	'utils',
	'trumbowyg',
	'trumbowyg_dk'
],

	function (App, Backbone, utils, moment, api, crossdomain, imagesLoaded, trumbowyg, trumbowyg_dk) {

		// Create a new module.
		var editContest = App.module();

		// Create view
		editContest.View = Backbone.View.extend({
			tagName : 'div',
			template: 'competitions/admin/editContest',
			initialize: function(){
				this.$el.appendTo("body");
				App.on('popup:editContest:close', this.closeEditContestPopup);	
			},
			serialize: function() {
				return this.model.toJSON();
			},
			
			closeEditContestPopup:function(){
				$.magnificPopup.close();
			},		
			
			afterRender: function(){
				var self = this;
				var popup = this.$el.magnificPopup({
					items: {
						src: $('#editContestDiv'),
						disableOn: 700,
						type: 'inline',
						mainClass: 'mfp-fade',
						removalDelay: 160,
						preloader: false, 
						fixedContentPos: false
					},
					closeBtnInside: false,
					callbacks: {
						open: function(){
							$('#setdate,#setopendate').datetimepicker({
								timepicker:false,
								format:'d/m/Y',
								formatDate:'Y/m/d' ,
								minDate:0
							});	
							
							$('#settime,#setopentime').datetimepicker({
								datepicker:false,
								format:'H:i'
							});				
							
							$('#showpubtime').click(function() {
								$('#pubtime').toggle();
								$('#apd').remove();
							});

							$('#showemailtext, .showemailtext').on('click', function() {
								$('#emailtext').toggle();
								$('#etxt').remove();
							});
							
							$('.adinputfield textarea').trumbowyg({
								lang: 'da',
								fullscreenable: false,
								closable: false,
								semantic: true,
								autogrow: true,
								btns: ['bold', 'italic', 'link', 'viewHTML']
							});
							
							$("[contenteditable]").on("paste", function(e) {
							   e.preventDefault();
							   var text = e.originalEvent.clipboardData.getData("text/plain");
							   document.execCommand("insertHTML", false, text);
							});
							
							var InputsWrapper  = $("#editAnswerDiv");
							var x = InputsWrapper.length; 
							var elem = $("#editAnswerDiv div.adinputfield83");
							var elemCount = elem.length;
							
							$(document).on('click', '.adaddnext2', function(e){
								$(InputsWrapper).append('<div class="adinputfield83"><span class="fe i-circled-cross adaddnextremove2" aria-hidden="true"></span><div class="checkaccept cacc1"><label class="option"><input type="radio" id="" name="correct" required><span class="cbox"></span></label> </div><input type="text" id="" placeholder="Skriv svarmulighed" required/></div></div>');
								return false;
							});

							$(document).on("click",".adaddnextremove2", function(e){ 
								if( elemCount > 1 ) {
									$(this).parent('div').hide(); 
									x--;
									$(".adaddnext2").last().show();
								}
								return false;
							});									
							
							$('form#editContestForm').submit(function(e){
								e.preventDefault();
								
								if(self.model.get('type') === 'image'){
									
									var form = $(this);
									var editContestData = utils.serializeToJSON(form);
									var xhrData = _.pick(editContestData, 'artist_id', 'title', 'description', 'contest_id');
									xhrData.endDate = moment(editContestData.endDate +' '+editContestData.endTime, 'DD/MM/YYYY hh:mm');									
									
								} else {
									
									var form = $(this);
									var editContestData = utils.serializeToJSON(form);
									var xhrData = _.pick(editContestData, 'artist_id', 'title', 'description', 'question', 'prize_winners', 'prize_name', 'contest_id');
									xhrData.endDate = moment(editContestData.endDate +' '+editContestData.endTime, 'DD/MM/YYYY hh:mm');
									
									xhrData.answers = [];
									
									form.find('.adinputfield83').each(function(i, v){
										var field = $(v);
										var id = field.find('input[name="answer"]').attr('id');										
										var answer = field.find('input[type="text"]').val();
										var correct = (field.find('input[type="radio"]').is(':checked') === true) ? true : false;
										var deleted = (field.find('input[type="text"]').is(':hidden') === true)? true : false;
										xhrData.answers.push({answer: answer, correct: correct, answer_id: id, deleted: deleted});
									});										
									
								}
								
								console.log(xhrData)
								
								api.put('/i/contest/' + editContestData.contest_id, xhrData, function(response){
									alert('Konkurrencen er opdateret');
									// Here is missing a method that refreshes the model data and re-renders the updated
									// view. This must be included into the restructure of Backbone code.
									App.trigger('popup:editContest:close');
									location.reload(); // this must be removed, but for now is the way to go.
								});			
							})	
						},						
						close: function() {
							self.$el.remove();
						}							
					}
				}, 0).magnificPopup('open');
				
			}
				
		});
		
		editContest.Model = Backbone.Model.extend({	
			url: function(){
				return App.APIO + '/i/contest/' + this.get('contest_id') + '?edit=true';
			},
			parse: function(response){
				return response.data;
			}
		});

		return editContest;
	});
define('modules/competitions/admin/createContest',[

	'app',
	'backbone',
	'utils',
	'moment',
	'API',
	'crossdomain',
	'utils',
	'trumbowyg',
	'trumbowyg_dk',	
],

	function (App, Backbone, utils, moment, api, crossdomain, trumbowyg, trumbowyg_dk) {

		// Create a new module.
		var createContest = App.module();

		// Create view
		createContest.View = Backbone.View.extend({
			template: 'competitions/admin/createContest',
			initialize: function(){
				this.$el.appendTo("body");
				App.on('popup:contest:close', this.closeContestPopup);
			},

			closeContestPopup:function(){
				$.magnificPopup.close();
			},
			
			afterRender: function(){
				var self = this;
				var popup = this.$el.magnificPopup({
					items: {
						src: '#simplecontestwiz',
						disableOn: 700,
						type: 'inline',
						mainClass: 'mfp-fade',
						removalDelay: 160,
						preloader: false, 
						fixedContentPos: false
					},
					closeBtnInside: false,
					callbacks: {
						open: function(){
							var InputsWrapper   = $("#answerDiv");
							var x = InputsWrapper.length; 
							var elem = $("#answerDiv div.adinputfield83");
							var elemCount = elem.length;
							
							// Add new Field answer
							$(document).on('click', '.adaddnext', function(e){
								$(InputsWrapper).append('<div class="adinputfield83"><span class="fe i-plus adaddnext" aria-hidden="true"></span><div class="checkaccept cacc1"><label class="option"><input type="radio" id="" name="correct" required><span class="cbox"></span></label> </div><input type="text" id="" placeholder="Skriv svarmulighed" required /></div></div>');
								$('.adinputfield83').prev().find('.adaddnext').replaceWith('<span class="fe i-circled-cross adaddnextremove" aria-hidden="true"></span>');
								return false;
							});

							$(document).on("click",".adaddnextremove", function(e){ 
								if( elemCount > 0 ) {
									$(this).parent('div').hide(); 
									x--;
									$(".adaddnext").last().show();
								}
								return false;
							});						

							$('#setdate,#setopendate').datetimepicker({
								timepicker:false,
								format:'d/m/Y',
								formatDate:'Y/m/d' ,
								minDate:0
							});	
							
							$('#settime,#setopentime').datetimepicker({
								datepicker:false,
								format:'H:i'
							});				
							
							$('#showpubtime').click(function() {
								$('#pubtime').toggle();
								$('#apd').remove();
							});

							$('#showemailtext, .showemailtext').on('click', function() {
								$('#emailtext').toggle();
								$('#etxt').remove();
							});
							
							$('.adinputfield textarea').trumbowyg({
								lang: 'da',
								fullscreenable: false,
								closable: false,
								semantic: true,
								autogrow: true,
								btns: ['bold', 'italic', 'link', 'viewHTML']
							});
							
							$("[contenteditable]").on("paste", function(e) {
							   e.preventDefault();
							   var text = e.originalEvent.clipboardData.getData("text/plain");
							   document.execCommand("insertHTML", false, text);
							});

							$("#contestArtistId").autocomplete({
								source: function(req, res){
									$.get(App.APIO+'/i/search/artist?name='+req.term, {delay: 1}, function(xhr){
										res(
											$.map(xhr.data, function (artist) {
												return {value: artist.name, label: artist.name, artist_id: artist.artist_id};
											})
										);
									});
								}, 
								select: function(event, ui){
									// set the artist_id to the hidden field
									$('[name="artist_id"]').val(ui.item.artist_id);
								}
							});

							$('form#contestForm').submit(function(e){
								e.preventDefault();
								
								$('.btncontest').attr('disabled','disabled');
									
								var form = $(this);
								var jsonFormData = utils.serializeToJSON(form);
								var xhrData = _.pick(jsonFormData, 'artist_id', 'title', 'description', 'prize', 'winners', 'type');
								// set the end contest date
								xhrData.endDate = moment(jsonFormData.endDate +' '+jsonFormData.endTime, 'DD-MM-YYYY hh:mm');
								// check if publication date is set and store
								if(jsonFormData.publicationDate && jsonFormData.publicationTime) xhrData.startDate = moment(jsonFormData.publicationDate+' '+jsonFormData.publicationTime, 'DD-MM-YYYY hh:mm');
								// Set question array
								xhrData.questions = [{title:jsonFormData.question, answers:[]}];
								
								// Loop on each answers an push to the array questions
								form.find('.adinputfield83').each(function(i, v){
									var field = $(v);
									var answer = field.find('input[type="text"]').val();
									var correct = (field.find('input[type="radio"]').is(':checked') === true) ? true : false;
									xhrData.questions[0].answers.push({answer: answer, correct: correct});
								});
		
								api.post('/i/contest', xhrData, function(response){
									alert('Konkurrencen er blevet oprettet!');
									App.trigger('app:contests:push', response.data);
									App.trigger('popup:contest:close');
								});

							});							
						},
						close: function() {
							self.$el.remove();
						}						
					}
				}, 0).magnificPopup('open');		
				
			}
				
		});
		

		return createContest;
	});
