define('modules/quiz/admin/submitQuiz',[

	'app',
	'backbone',
	'utils',
	'moment',
	'API',
	'modules/quiz/admin/questionnaireQuiz'
],

	function (App, Backbone, utils, moment, api, questionnaireQuiz) {

		// Create a new module.
		var submitQuiz = App.module();

		// Create view
		submitQuiz.View = Backbone.View.extend({
			tagName : 'div',
			className: 'quiz-questionnaire-item',
			template: 'quiz/admin/submitQuiz',
			initialize: function(){

				this.$el.appendTo("body");
				this.settings = {
					questionnaire_position:0
				};
	
			},
			addQuestionnaire: function(e, popupDiv){

				this.settings.questionnaire_position++;

				itm = new questionnaireQuiz({item_position: this.settings.questionnaire_position}).render().el;
				popupDiv.find('#questionsHolder').append(itm);
			},
			isContest: function(e, popupDiv, isContest){
				this.settings.isContest = isContest;
				var area = popupDiv.find('[data-is-contest-area]')
				if(isContest) {

					area.slideDown();
					area.find('[data-required]').attr('required', true);
					area.find('input, textarea').attr('skip-input', false);
					// set required
					
				} else {
					area.slideUp();
					area.find('[data-required]').attr('required', false);
					area.find('input, textarea').attr('skip-input', true);
				}
			},
			submitForm: function(e, popupDiv){
				e.preventDefault();
				var formData = utils.serializeToJSON(popupDiv.find('#quizForm input,textarea').not('[skip-input="true"]'));
				// Get each questionnaire data
				formData.questions = [];
				popupDiv.find('ul#questionsHolder > li').each(function(idx, it){
					var itm = $(it),
						answers = [];

					itm.find('[answer-item]').each(function(idx, answerEl){
						var answerItem = $(answerEl);
						answers.push({
							title: answerItem.find('input[type="text"]').val(),
							correct: answerItem.find('input[type="radio"]').prop('checked')
						})
					});

					formData.questions.push({
						title: itm.find('[name="question"]').val(),
						answers:answers
					});
				});

				xhrReq = _.pick(formData, 'title', 'questions', 'description', 'winners', 'artist_id', 'spotify_url');
				xhrReq.isContest = (formData.is_contest === 'on') ? true : false;
				xhrReq.endDate = moment(formData.endDate +' '+formData.endTime, 'DD-MM-YYYY hh:mm');

				api.post('/i/quiz', xhrReq, function(res){
					alert('Quiz er blevet oprettet!');
					location.reload();
				});
				
			},
			afterRender: function(){

				var self = this,
					popupDiv = $('#submitQuizDiv');

				var popup = this.$el.magnificPopup({
					items: {
						src: $('#submitQuizDiv'),
						disableOn: 700,
						type: 'inline',
						mainClass: 'mfp-fade',
						removalDelay: 160,
						preloader: false, 
						fixedContentPos: false
					},
					closeBtnInside: false,
					callbacks: {
						open: function(){
							// Initial calls
							self.isContest.call(self, null, popupDiv, false);

							popupDiv.find('#setdate,#setopendate').datetimepicker({
								timepicker:false,
								format:'d/m/Y',
								formatDate:'Y/m/d' ,
								minDate:0
							});	
							
							popupDiv.find('#settime,#setopentime').datetimepicker({
								datepicker:false,
								format:'H:i'
							});	

							// Add Questionnaire
							popupDiv.find('#addQuestionnaire').click(function(e){
								self.addQuestionnaire.call(self, e, popupDiv);
							});

							// Listen for is a content radio
							popupDiv.find('[name="is_contest"]').change(function(e){
								self.isContest.call(self, e, popupDiv, $(this).is(':checked'));
							});	

							popupDiv.find('form#quizForm').submit(function(e){
								self.submitForm.call(self, e, popupDiv);
							});

							popupDiv.find('#showemailtext').click(function(e){
								popupDiv.find('#emailtext').toggle();
							});



							// Search for artist
							popupDiv.find('[data-set-artist-completion]').autocomplete({
								source: function(req, res){
									$.get(App.APIO+'/i/search/artist?name='+req.term, {delay: 1}, function(xhr){
										res(
											$.map(xhr.data, function (artist) {
								            	return {value: artist.name, label: artist.name, artist_id: artist.artist_id};
								        	})
								        );
									});
								}, 
								select: function(event, ui){
									// set the artist_id to the hidden field
									popupDiv.find('[data-set-artist-completion-value]').val(ui.item.artist_id);
								}
							});	



						},
						close: function(){
							self.$el.remove();
						}
					}
				}, 0).magnificPopup('open');

			}	
		});
		
		// submitQuiz.Model = Backbone.Model.extend({	
		// 	url: function(){
		// 		// return App.APIO + '/i/contest/' + this.get('contest_id') + '?edit=true';
		// 	},
		// 	parse: function(res){
		// 		return res.data;
		// 	}
		// });

		return submitQuiz;
	});
