define('modules/admin/concert/addConcert',[

	'app',
	'backbone',
	'utils',
	'moment',
	'API',
	'utils'
],

	function (App, Backbone, utils, moment, api) {

		// Create a new module.
		var addConcert = App.module();

		addConcert.View = Backbone.View.extend({
			template: 'admin/concert/addConcert',
			initialize: function(){


				this.model = new addConcert.Model();
				this.$el.appendTo("body");

			},

			closeAndDestroy: function(){

				this.popup.magnificPopup('close');
				this.$el.remove();

			},

			// Function called when the form is submitted to call
			// API with the new artist information
			formSubmitted: function(e, el){

				e.preventDefault();
				var self = this;
				// get the values of the form
				var formData = utils.serializeToJSON(el.find('form input,textarea'));

				// Build date 
				formData.date = moment(formData.date + ' '+formData.time, 'DD-MM-YYYY hh:mm');
				formData.time = null;
				
				// set data to the Model
				this.model.set(formData);

				// Save into backend
				
				this.model.save(null, {
					success: function(model, res){

						// inform and redirect the admin to the new artist created.
						alert('Concert successfully created.');
						self.closeAndDestroy();	
					}
				});

			},

			// Active or deactivate submit based 
			formChanged: function(e, el){

				if(el.find('form')[0].checkValidity()) {
					el.find('button[type=submit]').prop('disabled', false);
				}
				else 
				{
					el.find('button[type=submit]').prop('disabled', true);
				}

			},

			afterRender: function(){

				var self = this;
				this.popup = this.$el.find('#addConcert');

				this.$el.magnificPopup({
					items: {
						src: this.popup,
						disableOn: 700,
						type: 'inline',
						mainClass: 'mfp-fade',
						removalDelay: 160,
						preloader: false, 
						fixedContentPos: false
					},
					closeBtnInside: false,
					callbacks: {
						open: function(){

							self.popup.find(':input').on('change', function(e){
								self.formChanged.call(self, e, self.popup);
							});

							self.popup.find('#setdate').datetimepicker({
								timepicker:false,
								format:'d/m/Y',
								formatDate:'Y/m/d' ,
								minDate:0,
								onChangeDateTime: function(){
									self.formChanged.call(self, null, self.popup);
								}
							});	
							
							self.popup.find('#settime').datetimepicker({
								datepicker:false,
								format:'H:i',
								onChangeDateTime: function(){
									self.formChanged.call(self, null, self.popup);
								}
							});	

							// set initial time to dates inputs
							self.popup.find('#setdate').datetimepicker( "setDate", new Date());
							self.popup.find('#settime').datetimepicker( "setDate", new Date());

							self.popup.find("#contestArtistId").autocomplete({
								source: function(req, res){
									$.get(App.APIO+'/i/search/artist?name='+req.term, {delay: 1}, function(xhr){
										res(
											$.map(xhr.data, function (artist) {
												return {value: artist.name, label: artist.name, artist_id: artist.artist_id};
											})
										);
									});
								}, 
								select: function(event, ui){
									// set the artist_id to the hidden field
									self.popup.find('[name="artist_id"]').val(ui.item.artist_id);
								}
							});

							self.popup.find('form').on('submit', function(e){
								self.formSubmitted.call(self, e, self.popup);
							});
								
						},
						close: function() {
							self.closeAndDestroy();
						}						
					}
				}, 0).magnificPopup('open');


			}
		});

		addConcert.Model = Backbone.Model.extend({
			url: App.APIO + '/i/concert',
			parse: function(res){ return res.data; }
		});


		return addConcert;
	});
