define('modules/artist/artistPoll',[

	'app',
	'backbone',
	'crossdomain',
	'imagesLoaded',
	'utils',
	'authentication',
	'io',
	'hello',
	'trumbowyg',
	'modules/shop/checkout',

],

	function (App, Backbone, crossdomain, imagesLoaded, utils, auth, io, hello, trumbowyg,  checkout) {

		// Create a new module.
		var ArtistPoll = App.module();

		// Create view
		ArtistPoll.View = Backbone.View.extend({
			template: 'artist/artistPoll',
			initialize: function() {
				$('.uploadVideo').hide();
				$('.updateFront').hide();
				$('.editContest').hide();				
				this.listenTo(this.model, 'sync', this.render);
				App.on('user:login:status:changed', this.loginStatusChanged, this);	
			},
			loginStatusChanged: function(user){
				if(user && user.role === 'admin'){
					$('.admin-panel').show();
					$('.uploadVideo').hide();
					$('.updateFront').hide();
					$('.editContest').hide();					
				} else {
					$('.admin-panel').hide();
					$('.uploadVideo').hide();
					$('.updateFront').hide();
					$('.editContest').hide();
				}
				$.magnificPopup.close();
			},
			serialize: function() {
				return this.model.toJSON();
			},
			
			events: {
				'click .selected': 'selected',
				'click .gotoShop': 'shopBuy',
				'click .btnfacebook2' : 'shareFacebook'
			},

			selected: function(e){
				e.preventDefault();
			},

			shareFacebook: function(e){

				var item = $(e.target);
				var url = window.location.href;

				// prepare the href
				var href= "https://www.facebook.com/dialog/feed?";
					href += "app_id="+App.clients.facebook.id;
					href += "&description=Hvilken by synes du, at TV-2 skal holde releasekoncert i? Vr med i konkurrencen om to billetter her.";
					href += "&link="+url;
					href += "&picture=https://static.musik.dk/upload/files/various_temp/tv2/fb/" + item.data('image') + ".jpg";
					href += "&name=Klik og stem!";
					href += "&redirect_uri="+url;

				item.attr('href', href);
				item.attr('target', '_blank');

			},
			
			shopBuy: function(){

				var checkoutData = _.first(this.model.get('shop')),
					user = auth.getUser();

				// Add artist name
				checkoutData.artistname = this.model.get('name');

				// Attach user info if available
				if(user) {
					checkoutData.email = user.email;
					checkoutData.name = user.name;
					checkoutData.phone = user.phone;
				}

				new checkout.View({model: new checkout.Model(checkoutData)});		

			},
			
			afterRender:function(){
				
				var user = auth.getUser();
				if(auth.isLogged() && user && user.role === 'admin') {	
					$('.admin-panel').show();
				} else {
					$('.updateFront').hide();
					$('.editContest').hide();
					$('.uploadVideo').hide();		
				}
				
				utils.removeMetaTags();
				$('.pollDescription').html(this.model.get('poll').description)
				
				$(document).prop('title', this.model.get('name') + ' - Afstemning - Det Gode Liv | MusikDK');
				utils.setMetaTag('name', 'description', this.model.get('name') +  ' Afstemning - Det Gode Liv ');
				
				// Facebook meta
				utils.setMetaTag('property', 'og:title', this.model.get('name') + ' - Afstemning - Det Gode Liv | MusikDK');
				utils.setMetaTag('property', 'og:site_name', 'MusikDK');
				if(this.model.get('images')){
					utils.setMetaTag('property', 'og:image', this.model.get('images').cover);
				}
				utils.setMetaTag('property', 'og:locale', 'da_DK');	
				utils.setMetaTag('property', 'og:description', this.model.get('name') +  ' Afstemning - Det Gode Liv');
				utils.setMetaTag('property', 'og:url', 'https://musik.dk/' + this.model.get('slug') + '/afstemning');
				
				// Twitter cards 
				utils.setMetaTag('name', 'twitter:title', this.model.get('name') + ' - Afstemning - Det Gode Liv | MusikDK');
				if(this.model.get('images')){
					utils.setMetaTag('name', 'twitter:image', this.model.get('images').cover);
				}
				utils.setMetaTag('name', 'twitter:url', 'https://musik.dk/' + this.model.get('slug') + '/afstemning');
				utils.setMetaTag('name', 'twitter:description', this.model.get('name') +  ' Afstemning - Det Gode Liv');						
				
				if (navigator.userAgent.match(/Trident/) || navigator.userAgent.match(/MSIE/)) {
					$('.iebgfix').each(function(){
						var url = $(this).css('background-image');
						$(this).css('background-image', url.replace('.svgz', '.png' ));
					});
				}; 	

					// Initialize all polls to default
					var itm, initialized = false;
					
					$('div[data-poll-item-id]').each(function(){
						itm = $(this).parent().parent().find('#vprogresspoll');
						itm.css('height', '2.5%');
						itm.attr('data-procentage', 0);
					});


					function changePollBarAttrs(pollItemId, percent){
						itm = $('div[data-poll-item-id="'+pollItemId+'"]').parent().parent().find('#vprogresspoll');
						itm.attr('data-procentage', percent);
						if(percent < 2.5 )
							return itm.css('height', '2.5%');
						if(initialized) 
							itm.css('height',  percent+'%');
						else 
							itm.delay(1500).css('height',  percent+'%');
					};

					// Set the current polls votes
					var pollsQuestions = this.model.get('poll').pollItems;

					$.each(pollsQuestions, function(i, v){
						changePollBarAttrs(v.pollItemId, v.percentage);
					});

					function activateItem(pollItemId){
						$('.vpoll[data-poll-item-id="'+pollItemId+'"]').attr('class', 'vpollactive');
					}

					function deactivateItem(pollItemId){
						$('.vpollactive[data-poll-item-id="'+pollItemId+'"]').attr('class', 'vpoll');
					}

					var socket;
					var poll_id = this.model.get('poll').poll_id;
					// Emmit our current poll to join as room
					function connectSocket(){
						if(auth.isLogged()){
							socket = io(App.APIO, {
								query: 'token='+auth.__getToken(),
								forceNew: 'true'
							});
							socket.on('artist:poll:vote:set:active', activateItem);
						}
						else 
						{
							socket = io(App.APIO, {forceNew: 'true'});
							// deselect all items as non voted
							$('.vpollactive').attr('class', 'vpoll');
						}
						socket.emit('artist:poll:join', poll_id);
					}

					App.on('user:login:status:changed', connectSocket);

					connectSocket();

					var self = this;

					socket.on('artist:poll:vote:max:reached', function(){
						window.setTimeout(function(){
							$.magnificPopup.open({
								items: {
									src: '#maxvotespopup'
								},
								callbacks: {
									open: function(){
										$(document).on('click', '.gotoShop', function(){
											$.magnificPopup.close();
											self.shopBuy.call(self);
										});
									},
									close: function(){

									}
								},
								type: 'inline'
							}, 0);
						}, 50);
					});

					// listen when changes on poll
					socket.on('artist:poll:votes:new', function(pollsItems){
						$.each(pollsItems, function(i,v){
							changePollBarAttrs(v.pollItemId, v.percentage);
						});
					});

					socket.on('artist:poll:vote:set:deactive', deactivateItem);

					// listen to activate poll Items when all the code was executed
					socket.on('artist:poll:vote:set:active', activateItem);

					var triggerVote = function(e){

						// Check login for non-authorized people to vote
						if(!auth.isLogged()) {
							$.magnificPopup.open({
								items: {
									src: '#signupbox'
								},
								type: 'inline'
							}, 0);
							return;					
						} else {
							$.magnificPopup.open({
								items: {
									src: '#maxvotespopup'
								},
								callbacks: {
									open: function(){
										$(document).on('click', '.gotoShop', function(){
											$.magnificPopup.close();
											self.shopBuy.call(self);
										});
									},
									close: function(){

									}
								},
								type: 'inline'
							}, 0);						
						}

						var pollItem = $(this);
						// Get the id of this poll
						pollItemId = pollItem.data('poll-item-id');
						socket.emit('artist:poll:vote:me', pollItemId);
					};

					// $('.pollactive').click(triggerVote);
					$('.vpoll').click(triggerVote);
			
					if($('#bg').find('canvas').length == 0){
						var cover = this.model.get('images').cover;
						utils.changeBackground(cover);
					}				
				}
		});
		
		ArtistPoll.Model = Backbone.Model.extend({
			url: function() {
				return App.APIO + '/i/artist/' + this.get('slug') + '/poll';
			},		
			parse: function(response){
				return response.data;
			},		
		});	

		return ArtistPoll;
	}
);
