define('modules/videopage/videos',[

	'app',
	'backbone',
	'utils',
	'authentication'
],

	function (App, Backbone, utils, auth) {

		// Create a new module.
		var Videos = App.module();

		// Create view
		Videos.View = Backbone.View.extend({
			tagName: 'div',
			className: 'ip2',
			template: 'videopage/singleVideo',
			initialize: function() {
				$('.uploadVideo').hide();
				$('.updateFront').hide();
				$('.editContest').hide();					
				this.listenTo(this.collection, 'sync', this.render, this);	
				App.on('user:login:status:changed', this.loginStatusChanged, this);	
			},
			serialize: function() {
				return this.collection ? this.collection.toJSON() : [];
			},
			events: {
				'click .vidPopup': 'seeVid'
			},
			
			loginStatusChanged: function(user){
				if(user && user.role === 'admin'){
					$('.admin-panel').show();
					$('.uploadVideo').hide();
					$('.updateFront').hide();
					$('.editContest').hide();						
				} else {
					$('.admin-panel').hide();
					$('.uploadVideo').hide();
					$('.updateFront').hide();
					$('.editContest').hide();	
				}
				$.magnificPopup.close();
			},
			
			openVideoPopupByYoutubeId: function(videoId){
				// We need to create a item that will hold the video document element by hidden in the DOM

				$.magnificPopup.open({
					items: {
						src: 'https://www.youtube.com/watch?v='+videoId
					},
					type: 'iframe',
					disableOn: 700,
					mainClass: 'mfp-fade',
					removalDelay: 160,
					preloader: false,
					fixedContentPos: false,
					callbacks: {
						close: function(){
							Backbone.history.navigate('/videoer', {replace: true}); 
						}
					}
				});
				
			},			
			
			seeVid: function(e) {
				e.preventDefault();
				var videoItem = $(e.currentTarget);
				this.openVidPopup(videoItem, videoItem.data('ytid'));
			},
			openVidPopup: function(jqueryRef, videoId){

				$.magnificPopup.open({
					disableOn: 700,
					items: {
						src: 'https://www.youtube.com/watch?v='+videoId
					},
					type: 'iframe',
					mainClass: 'mfp-fade',
					removalDelay: 160,
					preloader: false,
					fixedContentPos: false,
					callbacks: {
						open: function(){
							Backbone.history.navigate('/videoer?w='+videoId, {replace: true}); 
						},
						close: function(){
							Backbone.history.navigate('/videoer', {replace: true}); 
						}
					}
				});

			},			
			
			afterRender: function() {
				if(this.video !== null) this.openVideoPopupByYoutubeId(this.video);
				
				var user = auth.getUser();
				if(auth.isLogged() && user && user.role === 'admin') {	
					$('.admin-panel').show();
				} else {
					$('.admin-panel').hide();
					$('.uploadVideo').hide();
					$('.updateFront').hide();
					$('.editContest').hide();		
				}
				
				utils.changeBackground()
				
				if($('.navMenu ul').hasClass('acmenu')){
					$('.navMenu ul.acmenu').removeClass('acmenu')
				}
				$(document).prop('title', 'Videoer | MusikDK');
				
				utils.removeMetaTags();
				// Facebook meta tags
				utils.setMetaTag('property', 'og:title', 'Videoer p MusikDK');
				utils.setMetaTag('property', 'og:site_name', 'MusikDK');
				utils.setMetaTag('property', 'og:locale', 'da_DK');
				utils.setMetaTag('property', 'og:type', 'Website');	
				utils.setMetaTag('property', 'og:url', 'https://musik.dk/videoer');
				utils.setMetaTag('property', 'og:description', 'Se de nyeste videoer fra musik.dk');
				
				// Twitter cards
				utils.setMetaTag('name', 'twitter:image', 'https://static.musik.dk/assets/images/musikdklogo.png');	
				utils.setMetaTag('name', 'twitter:url', 'https://musik.dk/videoer/');
				utils.setMetaTag('name', 'twitter:description', 'Se de nyeste videoer fra musik.dk');
				utils.setMetaTag('name', 'twitter:title', 'Videoer p MusikDK');
				utils.setMetaTag('name', 'twitter:creator', '@MusikDK');
				utils.setMetaTag('name', 'twitter:site', '@MusikDK');
				utils.setMetaTag('name', 'twitter:card', 'https://static.musik.dk/assets/images/musikdklogo.png');		
				
				$(".singleVideos article:gt(11)").hide();
				var count =  $(".singleVideos article").length;

				var i = 8;
				$(".btnmore").on("click" , function() {
					i = i + 8;    
					$(".singleVideos article:lt(" + i + ")").show();
					if(i > count){
						$(".btnmore").hide();
					}
				});
							
			}
		});
		
		Videos.Collection = Backbone.Collection.extend({
			sync: function(method, collection, options){
				var met = 'GET';
				Backbone.ajax({
					method: met,
					url: this.url(),
				}).success(options.success).error(options.error);
			},
			url: function() {
				return App.APIO + '/i/videos';
			},
			parse: function(res) {
				return res.data;    
			}			
		});

		return Videos;
	});
