define('modules/competitions/popups/uploadImage',[

	'app',
	'backbone',
	'utils',
	'moment',
	'API',
	'crossdomain',
	'utils',
	'cropper',
	'authentication',
	'facebook'
],

	function (App, Backbone, utils, moment, api, crossdomain, cropper, auth, FB) {

		// Create a new module.
		var uploadImage = App.module();

		// Create view
		uploadImage.View = Backbone.View.extend({
			template: 'competitions/popups/imageUpload',
			initialize: function(){
				this.$el.appendTo('body');
				App.on('popup:contest:close', this.closePopup);	
			},		

			closePopup:function(){
				$.magnificPopup.close();
				$('#imgWrap').find('#tmp-ldr').remove();					
			},
			
			afterRender: function(){	

				var customCropperFixOutsideArea = function(el){

					var canvasData = el.cropper('getCanvasData');
					var cropBoxData = el.cropper('getCropBoxData');

					// Prevent the cropper to go down of the image limits.
					if( canvasData.height <= (cropBoxData.height + cropBoxData.top)) {
						cropBoxData.top = canvasData.height - cropBoxData.height;
					}

					if( canvasData.width <= (cropBoxData.width + cropBoxData.left)) {
						cropBoxData.left = canvasData.width - cropBoxData.width;
					}

					if( canvasData.width <= cropBoxData.width ) {
						cropBoxData.width = canvasData.width;
						cropBoxData.height = canvasData.width;
					}

					// Prevent the cropper selection, to be bigger than the image area
					if( cropBoxData.top < 0 ) {
						cropBoxData.top = 0;
						cropBoxData.width = canvasData.height;
					}

					if( cropBoxData.left < 0 ) {
						cropBoxData.left = 0;
						cropBoxData.height = canvasData.width;
					}

					el.cropper('setCropBoxData', cropBoxData);

				};



				var self = this;
				var el = this.$el.find('#imgupload');
				var uploadpopup = this.$el.magnificPopup({
					items: {
						src: el,
						type: 'inline',
					},
					preloader: false,
					closeOnBgClick: false,
					closeBtnInside: false,
					callbacks: {
						open: function(){
							$('#imgWrap').prepend('<div class="ip tc" id="tmp-ldr"><div class="imgloader"></div></div>')
																				
							// Read the image 
							var reader = new FileReader(); 
							reader.onloadend = function () {

								var imgCont = el.find('#imgContent');
								var img = imgCont.find('img');
								img.attr('src', reader.result);
								
								img.cropper({
									strict: false,
									// responsive: false,
									// // modal: false,
									guides: false,
									// highlight: false,
									// // // background: false,
									autoCrop: true,
									autoCropArea: 0.5,
									// movable: true,
									resizable: true,
									rotatable: false,
									zoomable: false,
									touchDragZoom: false,
									mouseWheelZoom: false,
									minCropBoxWidth: 105,
									minCropBoxHeight: 105,
									aspectRatio: 1 / 1,
									build: function () {
										// Remove loading spinner area
										$('#imgWrap').find('#tmp-ldr').remove();
									},
									built: function(){	

										var $this = $(this);
										var cropBoxData = $this.cropper('getCropBoxData');
										var imageData = $this.cropper('getImageData');



										$this.cropper('setCanvasData', imageData);

										// set crop box to the center
										$this.cropper('setCropBoxData', {top: ((imageData.height / 2) - (cropBoxData.height / 2)), left: ((imageData.width / 2) - (cropBoxData.width / 2))  });
										imgCont.css({height:imageData.height, width:imageData.width});


									},
									dragmove: function(e) {

										customCropperFixOutsideArea($(this));

									},

									dragend: function(){

										customCropperFixOutsideArea($(this));

									}

								});	

								// click handler to upload
								el.find('.btnupload').click(function(e){
									e.preventDefault();
									var imgHeight = img.cropper("getData").height;
									var imgWidth = img.cropper("getData").width;
									var imgCordX = img.cropper("getData").x;
									var imgCordY = img.cropper("getData").y;								
									// Create Form
									var fd = new FormData();
									fd.append("image", self.imageFile);
									fd.append("cropWidth", imgWidth);							
									fd.append("cropHeight", imgHeight);							
									fd.append("x", imgCordX);							
									fd.append("y", imgCordY);
									
									
									if (imgHeight<640 && imgWidth<640){
										alert('Billedet skal minimum have strrelsen 640x640 pixels!')
									} else {
									
										$('#imgWrap').prepend('<div class="ip tc" id="tmp-ldr"><div class="bigloader"></div></div>')
										$('#imgUploadContent').addClass('overlay');
										$('.btnimgupload').attr('disabled', true)
										// Custom ajax request
										api.postWithFiles('/i/contest/' + self.contest_id + '/upload', fd, false, false, function(res){
											$('#imgWrap').find('#tmp-ldr').remove();										
											App.trigger('popup:contest:close');
											Backbone.history.navigate('/konkurrencer/' + self.contest_id + '/upload/' + res.data.contest_user_image_id, {replace:true, trigger:true})	
											FB.XFBML.parse(self.$el.find('#fb-share')[0]);
											FB.XFBML.parse(self.$el.find('#fb-comments')[0]);											
										});											
									}

								});	


							}	
							reader.readAsDataURL(self.imageFile);								
							
						},
						close: function() {
							self.$el.remove();
							// Backbone.history.navigate('/konkurrencer/'+self.contest_id, {trigger:true})
							location.reload();
						}	
					}
				}, 0).magnificPopup('open');				
				
			}
				
		});
		

		return uploadImage;
	});

define('modules/competitions/popups/uploadImageDetails',[

	'app',
	'backbone',
	'utils',
	'API',
	'crossdomain',
	'utils',
	'authentication',
	'facebook'
],

	function (App, Backbone, utils, moment, api, crossdomain, auth, FB) {

		// Create a new module.
		var uploadImageDetails = App.module();

		// Create view
		uploadImageDetails.View = Backbone.View.extend({
			template: 'competitions/popups/imageUploadDetails',
			initialize: function(){
				this.$el.appendTo("body");
				App.on('popup:contest:close', this.closePopup);
				Backbone.history.navigate(this.model.get('path'), {trigger:false});
				this.model.on('sync', this.render, this);
			},
			
			closePopup:function(){
				$.magnificPopup.close();
				this.$el.remove();
			},

			beforeRender: function(){
				utils.removeMetaTags();
			},
				
			afterRender: function(){

				$(document).prop('title', (this.model.get('artist').formated_name + ': ' + this.model.get('title')) || 'Konkurrencer | MusikDK');

				var self = this;
				var detailsPopup = this.$el.magnificPopup({
					items: {
						src: '#imgpop',
						type: 'inline',
					},
					callbacks: {
						open: function(){
							
							// Facebook meta tags
							utils.setMetaTag('property', 'og:title', (self.model.get('artist').formated_name + ': ' + self.model.get('title')) || 'Konkurrencer | MusikDK');
							utils.setMetaTag('property', 'og:image', self.model.get('image_url'));
							utils.setMetaTag('property', 'og:site_name', 'MusikDK');
							utils.setMetaTag('property', 'og:locale', 'da_DK');
							utils.setMetaTag('property', 'og:type', 'Website');	
							utils.setMetaTag('property', 'og:url', self.model.get('url'));
							utils.setMetaTag('property', 'og:description', utils.removeHTMLfromString(self.model.get('description')));

							// Twitter cards
							utils.setMetaTag('name', 'twitter:image', self.model.get('image_url'));	
							utils.setMetaTag('name', 'twitter:url', self.model.get('url'));
							utils.setMetaTag('name', 'twitter:description', utils.removeHTMLfromString(self.model.get('description')));
							utils.setMetaTag('name', 'twitter:title', (self.model.get('artist').formated_name + ': ' + self.model.get('title')) || 'Konkurrencer | MusikDK');				
							utils.setMetaTag('name', 'twitter:creator', '@MusikDK');
							utils.setMetaTag('name', 'twitter:site', '@MusikDK');
							utils.setMetaTag('name', 'twitter:card', self.model.get('image_url') ||'https://static.musik.dk/assets/images/musikdklogo.png');

							FB.XFBML.parse(self.$el.find('#fb-share')[0]);
							FB.XFBML.parse(self.$el.find('#fb-comments')[0]);

						},
						close: function() {
							Backbone.history.navigate('/konkurrencer/'+self.model.get('contest_id'), {replace: true}); 
							self.$el.remove();
						}	
					}
				}, 0).magnificPopup('open');				
				
			}
				
		});
		
		uploadImageDetails.Model = Backbone.Model.extend({
			url: function(){
				return App.APIO + '/i/contest/' + this.get('contest_id') + '/upload/' + this.get('contest_user_image_id'); 
			},
			parse: function(res){
				return res.data;
			}
		});
		return uploadImageDetails;
	});

define('modules/competitions/contestImagesList',[

	'app',
	'backbone',
	'utils',
	'modules/competitions/popups/uploadImageDetails',
	'facebook'
],

	function (App, Backbone, utils, uploadImageDetails, FB) {

		// Create a new module.
		var contestImagesList = {};

		// Create view
		contestImagesList.ListView = Backbone.View.extend({
			id: 'image-list',
			initialize: function(){
				this.collection.on('sync', this.render, this);
			},
			beforeRender: function(el){

				// attach each item into the el
				this.collection.each(function(imageItem){
					imageItem.set('path', '/konkurrencer/' +  this.model.get('contest_id')  + '/upload/'+ imageItem.get('contest_user_image_id'));
					imageItem.set('url', location.protocol + '//' + location.host + imageItem.get('path'));
					imageItem.set('contest_id', this.model.get('contest_id'));
					imageItem.set('title', this.model.get('title'));
					imageItem.set('description', this.model.get('description'));
					imageItem.set('artist', this.model.get('artist'));
					this.insertView(new contestImagesList.itemView({model: imageItem }));
				}, this);

			},
			afterRender: function(){
				FB.XFBML.parse();
			},
			loadMoreItems: function(limit, offset){
				$('#image-list-wrapper').prepend('<div class="ip tc" id="imgupload-tmp-ldr"><div class="pr showmoreloader"></div></div>')
				this.collection.fetch({
					data:{
						limit:limit, 
						offset:offset
					}, 
					processData: true, 
					success: function(){
						$('#imgupload-tmp-ldr').remove();
					}, error: function(){
						alert('Der er sket en fejl!');
					}
				});
			}
				
		});

		contestImagesList.itemView = Backbone.View.extend({
			tagName: 'article',
			template: 'competitions/types/images/item',
			events: {
				'click' : 'itemClicked'
			},
			itemClicked: function(e){
				new uploadImageDetails.View({model:this.model}).render();
			}
		});
		
		contestImagesList.Collection = Backbone.Collection.extend({
			parse: function(res){
				if(res.data.contest_images) return res.data.contest_images;
				return [];
			}
		});
		return contestImagesList;

	});
